"37080":{"id":"37080","name":"Destinos Ligados","slug":"destinos-ligados","original_title":"Mother and Child","overview":"Um drama centrado em torno de três mulheres: Elizabeth (Naomi Watts) é uma advogada inteligente e bem sucedida que usa seu corpo para conseguir o que quer. Ela inicia um romance com o chefe (Samuel L. Jackson), que a contratou recentemente. Karen (Annette Bening) é uma profissional da saúde que vive amargurada, por ter engravidado aos 14 anos e entregue a filha para adoção. Lucy (Kerry Washington) é uma mulher casada que não consegue engravidar e resolve recorrer à adoção para ter a família que tanto deseja.","first_air_date":"2009-11-07","runtime":125,"episode_run_time":[125],"vote_average":6.6,"created_by":["Mockingbird Pictures","Everest Entertainment"],"production_companies":[{"name":"Mockingbird Pictures"},{"name":"Everest Entertainment"}],"cast":["Naomi Watts","Annette Bening","Kerry Washington","Jimmy Smits","Samuel L. Jackson"],"backdrop_path":"https://image.tmdb.org/t/p/original/f8CoZJ57F0KAZbcZEEzB1e8ZCp8.jpg","poster_path":"https://image.tmdb.org/t/p/original/tTJApDfPGhfvsf9FWXowbB4z6kb.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
"456287":{"id":"456287","name":"Mersal","slug":"mersal","original_title":"மெர்சல்","overview":"Alguns profissionais da área médica são assassinados ou sequestrados, e o policial que investiga o caso suspeita de um médico e o prende. Mas é ele quem está por trás desses crimes? E por que eles estão sendo comprometidos?","first_air_date":"2017-10-18","runtime":161,"episode_run_time":[161],"vote_average":7.2,"created_by":["Sri Thenandal Films"],"production_companies":[{"name":"Sri Thenandal Films"}],"cast":["Vijay","S. J. Suryah","Samantha Ruth Prabhu","Nithya Menen","Kajal Agarwal"],"backdrop_path":"https://image.tmdb.org/t/p/original/rx9kyO6YJLpXfFrU934C6i4yYMj.jpg","poster_path":"https://image.tmdb.org/t/p/original/65Q1wpRPZ5E3UVUv2V5JBbJQCcj.jpg","certification":"N/A","genres":["Thriller","Ação","Crime"],"trailer":"N/A"},
