"647498":{"id":"647498","name":"1942: A Batalha Desconhecida","slug":"1942-a-batalha-desconhecida","original_title":"Ржев","overview":"Após vários meses de combates ferozes, o Exército Vermelho finalmente derrotou o inimigo da aldeia de Ovsyannikovo, o que custou enormes perdas - apenas um terço do pessoal permanece na empresa. Exaustos, os soldados aguardam reforços, mas vem do quartel-general uma ordem - manter a aldeia a todo o custo, o que equivale a uma sentença de morte. O comandante da companhia enfrenta uma escolha difícil - perder os remanescentes da companhia, seguindo uma ordem de comando sem sentido, ou retirar seu pessoal do fogo de morteiro, mas ao mesmo tempo deixar suas posições e ir ao tribunal por violar a ordem. Em detalhes extremamente realistas, apenas uma batalha feroz é mostrada, na qual, como em uma gota d'água, toda a verdade sobre a guerra se reflete.","first_air_date":"2019-12-05","runtime":113,"episode_run_time":[113],"vote_average":7.7,"created_by":["3xMedia","Cinema Alliance","Aurum Production"],"production_companies":[{"name":"3xMedia"},{"name":"Cinema Alliance"},{"name":"Aurum Production"}],"cast":["Сергей Жарков","Иван Батарев","Олег Гаянов","Arseny Semenov","Александр Горбатов"],"backdrop_path":"https://image.tmdb.org/t/p/original/zZpWJh5kiYapUdMcSp6mkHTL3RQ.jpg","poster_path":"https://image.tmdb.org/t/p/original/ee8vgETGy7xRCM2VJh4tGW86nyk.jpg","certification":"12","genres":["Guerra","Drama","História"],"trailer":"Ea6qJ1arlgA"},
"407449":{"id":"407449","name":"Lucky","slug":"lucky","original_title":"Lucky","overview":"Depois de fumar por muito mais tempo que todos os seus conterrâneos, o velho ateu Lucky (Harry Dean Stanton), de 90 anos, está no fim de seus dias, apenas esperando a morte. Vivendo em uma cidade no deserto, ele inicia sua última atividade antes de partir: se autoexplorar para enfim encontrar iluminação.","first_air_date":"2017-09-29","runtime":88,"episode_run_time":[88],"vote_average":7.3,"created_by":["Divide / Conquer","Superlative Films"],"production_companies":[{"name":"Divide / Conquer"},{"name":"Superlative Films"}],"cast":["Harry Dean Stanton","David Lynch","Ron Livingston","Ed Begley Jr.","Tom Skerritt"],"backdrop_path":"https://image.tmdb.org/t/p/original/josJUt5eVMANf06mxSKnJlwjELB.jpg","poster_path":"https://image.tmdb.org/t/p/original/fy2K8jqCV9rNC8fHx9muPJTNaqs.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
"182":{"id":"182","name":"O Segredo de Berlim","slug":"o-segredo-de-berlim","original_title":"The Good German","overview":"Quem sabe o que o jornalista americano Jake Geisner (George Clooney) esperava encontrar em uma Berlim pós-guerra? Paz, talvez. Ou, ao menos, uma estória. Mas certamente não a bela Lena (Cate Blanchett), seu ex-amor. E também não uma trilha de segredo e decepção que une Lena a um jovem cabo (tobey Maguire), agora seu novo amante... E um assassinato que ninguém demostra interesse em resolver. A não ser Jake.","first_air_date":"2006-12-15","runtime":105,"episode_run_time":[105],"vote_average":5.8,"created_by":["Warner Bros. Pictures","Virtual Studios","Section Eight"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Virtual Studios"},{"name":"Section Eight"}],"cast":["George Clooney","Cate Blanchett","Tobey Maguire","Beau Bridges","Tony Curran"],"backdrop_path":"https://image.tmdb.org/t/p/original/vr9xAWJeIkYJWAYmIov5WNHEAf6.jpg","poster_path":"https://image.tmdb.org/t/p/original/gCmP8A2Crejq1YDnFQxgD0RAp8N.jpg","certification":"N/A","genres":["Drama","Mistério","Romance","Thriller","Guerra"],"trailer":"N/A"},
"26320":{"id":"26320","name":"Aconteceu em Woodstock","slug":"aconteceu-em-woodstock","original_title":"Taking Woodstock","overview":"Vivendo como designer de interiores em Nova York, Elliot sente-se empolgado pelo movimento dos direitos gays, mas, ao mesmo tempo, está preso ao negócio da família o El Monaco, um hotel decadente e endividado. No verão de 1969, ele volta sua atenção ao hotel para evitar que seja tomado pelo banco. Descobrindo que um festival de música e artes que aconteceria numa cidade vizinha à dele perdeu a licença para a sua realização, Elliot entra em contato com o produtor Michael Lang, vendo no evento a salvação do hotel. Rapidamente, a equipe do festival de Woodstock muda-se para o El Monaco e meio milhão de pessoas se dirige à fazenda de Max Yasgur, vizinho de Elliot, para “3 dias de Paz e Música em White Lake.”","first_air_date":"2009-08-26","runtime":120,"episode_run_time":[120],"vote_average":6.2,"created_by":["Focus Features","Ang Lee Productions"],"production_companies":[{"name":"Focus Features"},{"name":"Ang Lee Productions"}],"cast":["Demetri Martin","Imelda Staunton","Henry Goodman","Liev Schreiber","Jonathan Groff"],"backdrop_path":"https://image.tmdb.org/t/p/original/vcp1D7w5xnsDdeFQyTnAN31ky5S.jpg","poster_path":"https://image.tmdb.org/t/p/original/rtISyszSsvMnHI8axlEhr6y10On.jpg","certification":"N/A","genres":["Música","Comédia","Drama"],"trailer":"N/A"},
