"10183":{"id":"10183","name":"Rio Congelado","slug":"rio-congelado","original_title":"Frozen River","overview":"Ray Eddy vive em um trailer no interior do estado de Nova York. Tímida e reservada, ela enfrenta problemas para manter a família unida após seu marido ter sumido com o dinheiro que seria usado como entrada para a compra da casa de seus sonhos. Para conseguir a quantia Ray se une a Lila Littlewolf, uma contrabandista, e passa a atravessar ilegalmente imigrantes pela fronteira entre o Canadá e os Estados Unidos. O percurso segue o congelado rio St. Lawrence, com as duas transportando chineses e paquistaneses no porta-malas do carro de Ray.","first_air_date":"2008-03-26","runtime":97,"episode_run_time":[97],"vote_average":6.7,"created_by":["Harwood Hunt Productions","Cohen Media Group"],"production_companies":[{"name":"Harwood Hunt Productions"},{"name":"Cohen Media Group"}],"cast":["Melissa Leo","Misty Upham","Charlie McDermott","John Canoe","Jay Klaitz"],"backdrop_path":"https://image.tmdb.org/t/p/original/lu1xY551TaDj4Lx25RPsqizTBAr.jpg","poster_path":"https://image.tmdb.org/t/p/original/lsKeSYd3gq1QcGk2MI35MOMaef.jpg","certification":"12","genres":["Drama","Crime"],"trailer":"N/A"},
