"19064":{"id":"19064","name":"Procura-se Rapaz Virgem","slug":"procura-se-rapaz-virgem","original_title":"Once Bitten","overview":"Uma vampira com 400 anos, a Condessa (Lauren Hutton), está tendo um problema: para ter uma aparência jovem e bela ela precisa se alimentar três vezes com o sangue de um virgem antes do Halloween. Está cada vez mais difícil achar rapazes virgens em Los Angeles, mesmo com a ajuda do vampiro Sebastian (Cleavon Little), seu mordomo e motorista. Paralelamente Mark Kendall (Jim Carrey), que tem 21 anos, mas ainda é virgem, anseia em transar com sua namorada, Robin Pierce (Karen Kopins). Será a primeira vez para ambos, mas ela não pretende fazer amor dentro de um carro e pede para o namorado esperar um pouco. Mark então vai para um casa noturna com dois amigos, onde conhece a Condessa e logo vai para a casa dela. Quase ao amanhecer ele vai embora e não se lembra de quase nada, mas começa a comer carne crua e dormir dentro de um baú. Para piorar Robin descobre que Mark esteve com outra mulher e termina a relação, mas a Condessa ainda precisa dele.","first_air_date":"1985-11-15","runtime":94,"episode_run_time":[94],"vote_average":5.8,"created_by":["Night Light Films","The Samuel Goldwyn Company"],"production_companies":[{"name":"Night Light Films"},{"name":"The Samuel Goldwyn Company"}],"cast":["Jim Carrey","Lauren Hutton","Karen Kopins","Cleavon Little","Thomas Ballatore"],"backdrop_path":"https://image.tmdb.org/t/p/original/tOo41T9upKd5IaSbpl1yMeJ8Rqa.jpg","poster_path":"https://image.tmdb.org/t/p/original/oBWz0EjE6hXNpnoKMdF4cmLxRbY.jpg","certification":"N/A","genres":["Comédia","Terror","Romance"],"trailer":"N/A"},
