"13256":{"id":"13256","name":"A Era Da Escuridão: Mutant Chronicles","slug":"a-era-da-escuridao-mutant-chronicles","original_title":"Mutant Chronicles","overview":"Constantine (John Malkovich) é o chefe de uma das quatro empresas que lideram os continentes no mundo e que lutam contra a devastação total do planeta. No meio desta guerra entre corporações, surge um exército de \"NecroMutantes\" e apenas uma profecia pode vencer esta nação de assassinos surgidos do fundo da Terra. Apostando alto, Constantine coloca nas mãos de um grupo de 7 guerreiros, guiados por Samuel (Ron Perlman), um religioso, a responsabilidade de salvar o mundo. O Major Mitch Hunter, um fuzileiro que lidera os humanos na sua luta contra os mutantes, será seu principal aliado e buscará, junto com os demais guerreiros, a salvação de um mundo que parece totalmente perdido.","first_air_date":"2008-08-07","runtime":111,"episode_run_time":[111],"vote_average":5.3,"created_by":["Pressman Film","First Foot Films","Isle of Man Film","Paradox Entertainment"],"production_companies":[{"name":"Pressman Film"},{"name":"First Foot Films"},{"name":"Isle of Man Film"},{"name":"Paradox Entertainment"}],"cast":["Ron Perlman","Thomas Jane","Devon Aoki","Sean Pertwee","Benno Fürmann"],"backdrop_path":"https://image.tmdb.org/t/p/original/6gFKEYJ3UugiIm6JUGcoaEDah9M.jpg","poster_path":"https://image.tmdb.org/t/p/original/mTjPjWh7EwPCKPmFZs7HOszPj9Q.jpg","certification":"N/A","genres":["Ação","Aventura","Terror","Ficção científica"],"trailer":"xi_Y5hHCTfw"},
"27989":{"id":"27989","name":"Armadilhas do Amor","slug":"armadilhas-do-amor","original_title":"Serious Moonlight","overview":"Louise é uma consagrada advogada de Manhattan que não vê a hora de passar o fim de semana ao lado de Ian, com quem vive há 13 anos. Na casa de campo ela é recebida com um buquê de rosas, mas acaba descobrindo que as flores foram encomendadas para a amante do maridão, Sara, muito mais jovem do que ela. Em segredo, ele já começou o processo de separação da mulher. Enfurecida e não se conformando com a notícia, Louise resolve manter Ian em cativeiro. Ela se recusa a liberá-lo enquanto ele não voltar a pensar no casamento. O filme é muito mais do que uma divertida guerra dos sexos. É uma batalha entre pessoas que pensam diferente.","first_air_date":"2009-12-04","runtime":81,"episode_run_time":[81],"vote_average":5.0,"created_by":["All For A Films","Magnolia Pictures","Night & Day Pictures"],"production_companies":[{"name":"All For A Films"},{"name":"Magnolia Pictures"},{"name":"Night & Day Pictures"}],"cast":["Meg Ryan","Timothy Hutton","Justin Long","Kristen Bell","Derek Carter"],"backdrop_path":"https://image.tmdb.org/t/p/original/dJuiJHokAKwjdfNOIYNQfykPCaJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/pKgnYSICKWENvIr6tZ3gc8h8Y59.jpg","certification":"N/A","genres":["Comédia","Romance"],"trailer":"N/A"},
"157099":{"id":"157099","name":"Rolou Uma Química","slug":"rolou-uma-quimica","original_title":"Better Living Through Chemistry","overview":"A vida sem graça de um farmacêutico de uma cidadezinha é virada pelo avesso, quando um encontro casual com uma bela mulher casada e solitária se torna uma aventura selvagem, nesta hilariante comédia de humor negro, estrelada por Sam Rockwell e Olivia Wilde. Doug Varney (Sam Rockwell) sempre foi ignorado durante anos, por todo o mundo, desde Kara (Michelle Monaghan), sua esposa dominadora, até pelos preguiçosos empregados da farmácia que ele comprou de seu sogro insuportável. Quando Doug começa um caso regado a álcool e drogas com Elizabeth (Olivia Wilde), a mulher mais bonita que já conheceu, ninguém fica mais surpreso que ele mesmo. Elenco: Sam Rockwell, Olivia Wilde, Michelle Monaghan, Ray Liotta, Jane Fonda.","first_air_date":"2014-03-14","runtime":92,"episode_run_time":[92],"vote_average":5.9,"created_by":["Ealing Metro International","Occupant Entertainment","Altus Productions","Aegis Film Fund"],"production_companies":[{"name":"Ealing Metro International"},{"name":"Occupant Entertainment"},{"name":"Altus Productions"},{"name":"Aegis Film Fund"}],"cast":["Sam Rockwell","Michelle Monaghan","Olivia Wilde","Jane Fonda","Ray Liotta"],"backdrop_path":"https://image.tmdb.org/t/p/original/qnx8XZfvCNhRZCWThq2UW2BV5Gb.jpg","poster_path":"https://image.tmdb.org/t/p/original/6DriWaJrWJai7Aq5H012kg8x7d5.jpg","certification":"N/A","genres":["Drama","Comédia"],"trailer":"mdmGJCjF-lk"},
