"13950":{"id":"13950","name":"Amigos Por Acaso","slug":"amigos-por-acaso","original_title":"All About the Benjamins","overview":"Em Miami, o caçador de prêmios Bucum Jackson (Ice Cube) usa metódos pouco ortodoxos e se recusa a ter um parceiro. Apesar de ser muito competente no que faz, Jackon já se cansou de sua perigosa e pouca gratificante profissão. Sonha mudar de ares e abrir a própria firma de investigação particular. Sem dinheiro para começar o negócio, Bucum é dorçado a realizar mais uma missão: perseguir e capturar Reggie Wright (Mike Epps), im pequeno vigarista que fala pelos cotovelos e que já cruzou o seu caminho anteriormente. Quando os dois finalmente se reencontram, Reggie tropeça em dois ladrões sofisticados que acabaram de roubar um diamante que vale 20 milhões de dólares. Quando Bucum captura Reggie, este lhe faz uma proposta: se unirem para pegar o tal diamante, passando a perna nos ladrões e na polícia de Miami.","first_air_date":"2002-03-08","runtime":95,"episode_run_time":[95],"vote_average":5.9,"created_by":["New Line Cinema","Cube Vision"],"production_companies":[{"name":"New Line Cinema"},{"name":"Cube Vision"}],"cast":["Ice Cube","Mike Epps","Eva Mendes","Tommy Flanagan","Carmen Chaplin"],"backdrop_path":"https://image.tmdb.org/t/p/original/3Z9n1DjfYzvknQvoLLkMCvQsSxz.jpg","poster_path":"https://image.tmdb.org/t/p/original/93dO9rDDeuKGOgSdIx3d69AjhhN.jpg","certification":"N/A","genres":["Ação","Aventura","Comédia"],"trailer":"N/A"},
