"718838":{"id":"718838","name":"O Domingo das Mães","slug":"o-domingo-das-maes","original_title":"Mothering Sunday","overview":"Inglaterra, 1924. Jane Fairchild trabalha como doméstica na casa dos Niven. Ela ganha uma folga no Dia das Mães, enquanto o sr. e a sra. Niven participam da celebração do noivado de Paul, filho de seus vizinhos. Jane está feliz com a repentina liberdade em um lindo domingo de primavera. Por quase sete anos, ela foi amante de Paul. Como os Nivens, o rapaz pertence à velha aristocracia inglesa, enquanto Jane ficou órfã quando nasceu. Hoje será o último dia deles como amantes, e também o dia que marcará o início da transformação de Jane. Com Odessa Young, Josh O'Connor, Olivia Colman, Colin Firth e Glenda Jackson. Seleção dos Festivais de Cannes e Toronto e da 45ª Mostra de Cinema de São Paulo, em 2021.","first_air_date":"2021-11-12","runtime":104,"episode_run_time":[104],"vote_average":5.4,"created_by":["Number 9 Films","Film4 Productions","BFI","Lipsync Productions","ZDF/Arte"],"production_companies":[{"name":"Number 9 Films"},{"name":"Film4 Productions"},{"name":"BFI"},{"name":"Lipsync Productions"},{"name":"ZDF/Arte"}],"cast":["Odessa Young","Josh O'Connor","Sope Dirisu","Patsy Ferran","Emma D'Arcy"],"backdrop_path":"https://image.tmdb.org/t/p/original/ltVm9tMK32x56ezpHgJp0U5YQdY.jpg","poster_path":"https://image.tmdb.org/t/p/original/6zOXT6wm4Z7HxtLwElYiqftispE.jpg","certification":"N/A","genres":["Romance","Drama"],"trailer":"N/A"},
