"34205":{"id":"34205","name":"Halloweentown 2: A Vingança de Kalabar","slug":"halloweentown-2-a-vinganca-de-kalabar","original_title":"Halloweentown II: Kalabar's Revenge","overview":"Um ano depois, ocorre uma festa de Halloween na casa dos Cromwell, aonde estão Marnie, Dylan e Sophie. Então os novos vizinhos chegam, e eles são Carl e Alex, Marnie mostra a casa para Carl e ele pega o livro de feitiços, coisas estranhas estão acontecendo em Halloweentown, que tudo é causado pelo filho de Kalabar, Carl, agora os Cromwells precisam salvar Halloweentown de novo. Quando Marnie volta a Haloweentown com sua avó está tudo diferente Carl o filho de Kalabar havia lançado o feitiço cinza que ele pegou no livro que havia roubado da casa de Marnie só para garantir que ela não conseguiria quebrar o feitiço. Será que Marnie conseguirá salvar Halloweentown e O Mundo Humano?","first_air_date":"2001-10-12","runtime":81,"episode_run_time":[81],"vote_average":6.8,"created_by":["Just Singer Entertainment"],"production_companies":[{"name":"Just Singer Entertainment"}],"cast":["Kimberly J. Brown","Judith Hoag","Daniel Kountz","Joey Zimmerman","Emily Roeske"],"backdrop_path":"https://image.tmdb.org/t/p/original/AfMAcS5HmPPRtJ3d9tipXTQV2Xt.jpg","poster_path":"https://image.tmdb.org/t/p/original/kIN8dIqF2UdBulI3ohv5aMAG5D4.jpg","certification":"N/A","genres":["Aventura","Família","Fantasia","Cinema TV"],"trailer":"N/A"},
"29339":{"id":"29339","name":"O Herói da Família","slug":"o-heroi-da-familia","original_title":"Nicholas Nickleby","overview":"Depois da morte do patriarca da família, o jovem Nicholas Nickleby e sua família são deixados sem nada para sobreviver. A família é forçada a se dividir e Nicholas acaba em uma escola dirigida pelo cruel diretor Wackford Squeers. Eventualmente, Nicholas fica amigo de Smike, um garoto órfão, e os dois conseguem se libertar. Nicholas se une à sua família, mas sabendo que agora deve defender sua irmã dos amigos investidores do tio.","first_air_date":"2002-12-27","runtime":132,"episode_run_time":[132],"vote_average":6.9,"created_by":["Hart-Sharp Entertainment","Potboiler Productions","United Artists","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Hart-Sharp Entertainment"},{"name":"Potboiler Productions"},{"name":"United Artists"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Charlie Hunnam","Nathan Lane","Jim Broadbent","Christopher Plummer","Jamie Bell"],"backdrop_path":"https://image.tmdb.org/t/p/original/bvhAbUMsDfFTseAAoPE49JJ0ebA.jpg","poster_path":"https://image.tmdb.org/t/p/original/uLilCY2We3Ore9Ke7CdafntHvmT.jpg","certification":"14","genres":["Aventura","Drama"],"trailer":"N/A"},
