"11050":{"id":"11050","name":"Laços de Ternura","slug":"lacos-de-ternura","original_title":"Terms of Endearment","overview":"Aurora (Shirley MacLaine), uma viúva, e Emma (Debra Winger), sua filha, apesar de se amarem tem uma relação conflituosa. Entretanto, tudo muda quando a filha descobre que está com câncer e, ao mesmo tempo, toma consciência de que foi traída por Flap (Jeff Daniels), seu marido. Simultaneamente sua mãe após anos passa a se interessar por Garrett Breedlove (Jack Nicholson), um ex astronauta vizinho e paquerador.","first_air_date":"1983-11-20","runtime":132,"episode_run_time":[132],"vote_average":7.1,"created_by":["Paramount Pictures"],"production_companies":[{"name":"Paramount Pictures"}],"cast":["Shirley MacLaine","Debra Winger","Jack Nicholson","Danny DeVito","Jeff Daniels"],"backdrop_path":"https://image.tmdb.org/t/p/original/rZXTcmx7mKysaseyWZHs6wzPAcZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/9IZsFM6IowOVEGSa8mG1QDGcaZ7.jpg","certification":"14","genres":["Drama","Comédia"],"trailer":"N/A"},
"43278":{"id":"43278","name":"A Vida de Emile Zola","slug":"a-vida-de-emile-zola","original_title":"The Life of Emile Zola","overview":"O ator Paul Muni foi o rei das chamadas cinebiografias nos Anos Dourados de Hollywood, criando uma galeria de grande interpretações. Warner Bros era o estúdio de maior evidência na época entre o gosto popular, oferecendo ao público, produções arrebatadoras e polêmicas, banhadas de contestação social. Estas duas forças do estrelato e do humanitarismo se uniram em 1937, neste marco da cinematografia: Emile Zola foi a primeira produção da Warner a ganhar o Oscar de Melhor Filme (ainda recebeu outras 10 indicações e 3 estatuetas). O filme narra a ascensão do escritor francês Emile Zola e seu envolvimento na defesa do capitão Alfred Dreyfus, um militar condenado injustamente sob a acusação de traição apenas por ser judeu. Na verdade, ele passa a se interessar pelo caso somente quando procurado pela esposa de Dreyfus, e desafia os militares publicando o famoso J'accuse, um manifesto a favor do capitão.","first_air_date":"1937-09-09","runtime":116,"episode_run_time":[116],"vote_average":6.7,"created_by":["Warner Bros. Pictures"],"production_companies":[{"name":"Warner Bros. Pictures"}],"cast":["Paul Muni","Gale Sondergaard","Joseph Schildkraut","Gloria Holden","Donald Crisp"],"backdrop_path":"https://image.tmdb.org/t/p/original/qsqFiqjdscd0j4jjI45CP9GgtfC.jpg","poster_path":"https://image.tmdb.org/t/p/original/ylSFT2IltnDFhN9DqxsTcYZRdxw.jpg","certification":"Livre","genres":["Drama","História"],"trailer":"N/A"},
"318279":{"id":"318279","name":"Meru: O Centro do Universo","slug":"meru-o-centro-do-universo","original_title":"Meru","overview":"Na tentativa de realizar uma escalada nunca antes concluída, três alpinistas de elite deixam tudo para trás, exceto a amizade entre eles, enquanto lutam com perdas dolorosas e ásperos elementos da natureza. Eles tentam terminar a subida que é tão cobiçada e perigosa, chamada Shark's Fin, no monte Meru. .","first_air_date":"2015-01-25","runtime":89,"episode_run_time":[89],"vote_average":7.4,"created_by":["Little Monster Films"],"production_companies":[{"name":"Little Monster Films"}],"cast":["Conrad Anker","Jimmy Chin","Renan Öztürk","Jon Krakauer","Jenni Lowe-Anker"],"backdrop_path":"https://image.tmdb.org/t/p/original/pjMm3ChyDqsfq2STH4MlMVjZmJz.jpg","poster_path":"https://image.tmdb.org/t/p/original/oQsMMSTJnWneD9YwYbUbsJzbQ7f.jpg","certification":"N/A","genres":["Aventura","Documentário"],"trailer":"N/A"},
