"745611":{"id":"745611","name":"Delicioso - Da Cozinha para o Mundo","slug":"delicioso-da-cozinha-para-o-mundo","original_title":"Délicieux","overview":"No alvorecer da Revolução Francesa, Pierre Manceron, um cozinheiro ousado, mas orgulhoso, foi demitido por seu mestre, o duque de Chamfort. Conhecer uma mulher surpreendente, que deseja aprender a arte culinária ao seu lado, dá-lhe autoconfiança e o leva a se libertar de sua condição de servo para empreender sua própria revolução. Juntos, eles vão inventar um lugar de prazer e partilha aberto a todos: o primeiro restaurante. Uma ideia que fará com que eles ganhem clientes… e inimigos. Seleção do Festival Varilux 2021. Filme de encerramento do Festival de San Sebastian 2021.","first_air_date":"2021-09-08","runtime":112,"episode_run_time":[112],"vote_average":6.9,"created_by":["Nord-Ouest Films","SND","France 3 Cinéma","Artémis Productions","RTBF","VOO","BeTV","Shelter Prod"],"production_companies":[{"name":"Nord-Ouest Films"},{"name":"SND"},{"name":"France 3 Cinéma"},{"name":"Artémis Productions"},{"name":"RTBF"},{"name":"VOO"},{"name":"BeTV"},{"name":"Shelter Prod"}],"cast":["Isabelle Carré","Grégory Gadebois","Benjamin Lavernhe","Guillaume de Tonquédec","Christian Bouillette"],"backdrop_path":"https://image.tmdb.org/t/p/original/j2rCXGUk11O34kyGpYrRP2SFm03.jpg","poster_path":"https://image.tmdb.org/t/p/original/vNLZrItbgSb3FgHpEBAnoNieK4z.jpg","certification":"12","genres":["História","Comédia","Drama"],"trailer":"N/A"},
