"14043":{"id":"14043","name":"Nancy Drew e o Mistério de Hollywood","slug":"nancy-drew-e-o-misterio-de-hollywood","original_title":"Nancy Drew","overview":"Com a sua lupa e o pó de impressão digital nas mãos, Nancy Drew deixa River Heights para Hollywood... mas não para encontrar aquele cara de Smallville, como teme o seu namorado Ned. Não, ela está fora para resolver um grande mistério: a morte da estrela de cinema Dehlia Draycott Mas o grande mistério é como nossa esperta detetive que veste xadrez, irá se adaptar ao significado das mensagens de texto das rainhas adolescentes que ela encontra na escola Hollywood High. Junte-se a Emma Roberts como Nancy neste mistério infinito da garota detetive que encontra perigo, aventura e romance. Porque onde quer que a Nancy vá, a animação a segue.","first_air_date":"2007-06-15","runtime":99,"episode_run_time":[99],"vote_average":6.1,"created_by":["Jerry Weintraub Productions","Virtual Studios","Warner Bros. Pictures"],"production_companies":[{"name":"Jerry Weintraub Productions"},{"name":"Virtual Studios"},{"name":"Warner Bros. Pictures"}],"cast":["Emma Roberts","Max Thieriot","Josh Flitter","Rachael Leigh Cook","Kay Panabaker"],"backdrop_path":"https://image.tmdb.org/t/p/original/v8QN8VZmKPPzcA6Z0RXTU9ohDy1.jpg","poster_path":"https://image.tmdb.org/t/p/original/shYrJwp5hWHQjzmIX2U47H9nt8K.jpg","certification":"N/A","genres":["Família","Aventura","Crime","Mistério","Comédia"],"trailer":"N/A"},
