"13576":{"id":"13576","name":"Michael Jackson's This Is It","slug":"michael-jackson-s-this-is-it","original_title":"This Is It","overview":"“This Is It” oferece aos fãs de Michael e apreciadores de música de todo mundo, uma rara e especial visão dos bastidores do artista, mostrando o desenvolvimento, a criação e os ensaios dos espetáculos que já tinham lotação esgotada e iriam começar no verão de 2009 na O2 Arena, em Londres. Seguindo uma narrativa entre Abril e Junho de 2009, o filme representa mais de 100 horas de bastidores apresentando Michael Jackson ensaiando diversas músicas para os shows.","first_air_date":"2009-10-28","runtime":111,"episode_run_time":[111],"vote_average":7.2,"created_by":["Columbia Pictures","AEG Live","The Michael Jackson Company"],"production_companies":[{"name":"Columbia Pictures"},{"name":"AEG Live"},{"name":"The Michael Jackson Company"}],"cast":["Michael Jackson","Orianthi","Kenny Ortega","Dorian Holley","Patrick Woodroffe"],"backdrop_path":"https://image.tmdb.org/t/p/original/mqAuLsN6oOme6lSKoTb6yyP4U8E.jpg","poster_path":"https://image.tmdb.org/t/p/original/boeT9GbgZPYJnv6NtjoaGT3IagK.jpg","certification":"L","genres":["Música","Documentário"],"trailer":"N/A"},
