"47104":{"id":"47104","name":"Através das Oliveiras","slug":"atraves-das-oliveiras","original_title":"زیر درختان زیتون","overview":"Uma equipe de cinema chega a uma pequena cidade no norte do Irã, devastada por um tremor de terra, para realizar um filme. Hossein (Hossein Rezai) é contratado para ser o protagonista. Por acaso, a atriz que contracena com ele é Tahere (Tahere Ladanian), uma jovem por quem ele está apaixonado, mas que a família tinha recusado para o casamento. Enquanto ele diz todas as suas falas, Tahere permanece calada. O diretor descobre o amor platônico que Hossein sente por Tahere. Após algumas pressões, Tahereh aceita atuar normalmente e começa a cumprir seu trabalho. Mas não é fácil, ao menos para Farhad - na história que está sendo filmada, eles são recém-casados. Nos intervalos entre os takes, ele tenta de todas as maneiras obter uma resposta de sua amada. Entretanto, ela não parece muito interessada em responder.","first_air_date":"1994-02-01","runtime":103,"episode_run_time":[103],"vote_average":7.4,"created_by":["CiBy 2000","Abbas Kiarostami Productions","Farabi Cinema"],"production_companies":[{"name":"CiBy 2000"},{"name":"Abbas Kiarostami Productions"},{"name":"Farabi Cinema"}],"cast":["محمدعلی کشاورز","Farhad Kheradmand","Zarifeh Shiva","Hossein Rezai","Tahereh Ladanian"],"backdrop_path":"https://image.tmdb.org/t/p/original/6pNbXgSg70qInZ4I3VaS2at5spK.jpg","poster_path":"https://image.tmdb.org/t/p/original/xcwCF0YTyAOMrVLgXHjvPP0gGbh.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
"660521":{"id":"660521","name":"O Mercenário","slug":"o-mercenario","original_title":"The Mercenary","overview":"Depois que uma missão na América do Sul deu errado, um mercenário fica entre a vida e a morte, mas sobrevive graças aos cuidados dos habitantes de um vilarejo. Mas agora, para proteger o local, ele se vê obrigado a lutar contra os seus antigos parceiros.","first_air_date":"2020-01-07","runtime":91,"episode_run_time":[91],"vote_average":6.1,"created_by":["War Dog Productions"],"production_companies":[{"name":"War Dog Productions"}],"cast":["Dominique Vandenberg","Louis Mandylor","Carmen Argenziano","Manny Alva","Brad Ashten"],"backdrop_path":"https://image.tmdb.org/t/p/original/7dCzb1oa7ACYi66VIrE1wqmftAa.jpg","poster_path":"https://image.tmdb.org/t/p/original/e6UpLOZZDDadXQGqkERfuvxiEJp.jpg","certification":"18","genres":["Ação"],"trailer":"N/A"},
"466532":{"id":"466532","name":"Clara: Um Amor Além do Universo","slug":"clara-um-amor-alem-do-universo","original_title":"Clara","overview":"O Dr. Isaac Bruno, astrônomo e professor de astrofísica da Universidade de Ontário em Toronto, é obcecado com a ideia de descobrir que existe vida no cosmos além da Terra. Essa obsessão é, em parte, uma tentativa de preencher um vazio em sua vida pessoal após uma tragédia. Quando Isaac conhece a artista Clara, os dois formam uma inesperada parceria que os leva a uma descoberta inexplicável.","first_air_date":"2018-11-30","runtime":105,"episode_run_time":[105],"vote_average":7.5,"created_by":["Serendipity Point Films"],"production_companies":[{"name":"Serendipity Point Films"}],"cast":["Patrick J. Adams","Troian Bellisario","Kristen Hager","Ennis Esmer","R.H. Thomson"],"backdrop_path":"https://image.tmdb.org/t/p/original/7zKaMAH0nAxJHCQ6tsKYiueUikL.jpg","poster_path":"https://image.tmdb.org/t/p/original/x3UaDiNrensNXXZgpadRcUear1N.jpg","certification":"10","genres":["Ficção científica","Drama","Romance"],"trailer":"xJWFyiuEeNM"},
"76758":{"id":"76758","name":"Flores do Oriente","slug":"flores-do-oriente","original_title":"金陵十三釵","overview":"Em 1937, Nanquim encontra-se na frente de batalha entre China e Japão. Enquanto o exército imperial japonês invade a capital da China, os habitantes desesperados procuram refúgio atrás dos muros de uma catedral ocidental. Ali, John Miller (Christian Bale), um americano preso no meio do caos da batalha e da ocupação que se segue abriga-se, seguido por um grupo de estudantes inocentes e quatorze prostitutas, igualmente determinadas a fugir dos horrores que ocorrem do lado de fora da catedral. Lutando para sobreviver à violência e perseguição do exército japonês, um ato de heroísmo acaba levando um grupo aparentemente discrepante, a arriscar suas vidas pelo bem de todos.","first_air_date":"2011-12-15","runtime":142,"episode_run_time":[142],"vote_average":7.5,"created_by":["New Picture Company","Beijing New Picture Film Co. Ltd.","EDKO Film"],"production_companies":[{"name":"New Picture Company"},{"name":"Beijing New Picture Film Co. Ltd."},{"name":"EDKO Film"}],"cast":["Christian Bale","倪妮","佟大为","張歆怡","小林成男"],"backdrop_path":"https://image.tmdb.org/t/p/original/ca0a79cbCGWJdan3SEBKkQBSwKi.jpg","poster_path":"https://image.tmdb.org/t/p/original/6OBhpnPcL7kHX8KW8l5n603TNbC.jpg","certification":"16","genres":["Drama","História","Guerra"],"trailer":"Goc-8K0JNHc"},
"616584":{"id":"616584","name":"Melanie Martinez: K-12","slug":"melanie-martinez-k-12","original_title":"K-12","overview":"Neste filme musical misteriosamente encantador de Melanie Martinez, Cry Baby, uma garota forte e sensível, é enviada para uma escola perturbadora do sono que se opõe severamente à individualidade. Com a ajuda de seus amigos mágicos e um Guia Angélico Espiritual, eles ganham a força que precisam para lutar contra a equipe maligna da escola e derrubar o sistema escolar opressivo do K-12.","first_air_date":"2019-09-05","runtime":96,"episode_run_time":[96],"vote_average":7.8,"created_by":["Atlantic Records","Little Ugly","Frame 48","Abramorama"],"production_companies":[{"name":"Atlantic Records"},{"name":"Little Ugly"},{"name":"Frame 48"},{"name":"Abramorama"}],"cast":["Melanie Martinez","Elita Harkov","Megan Gage","Maggie Budzyna","Zión Moreno"],"backdrop_path":"https://image.tmdb.org/t/p/original/xnCD0VhBVqvqE47PIlYM2M88Hif.jpg","poster_path":"https://image.tmdb.org/t/p/original/nVi0yBBPj5Z96JgGWVIg94kv7bR.jpg","certification":"14","genres":["Música","Fantasia"],"trailer":"gErrfCN1BxU"},
