"149427":{"id":"149427","name":"Era uma Vez... A Estrela do Natal","slug":"era-uma-vez-a-estrela-do-natal","original_title":"Reisen til julestjernen","overview":"Sonja de 13 anos, bondosa, chega a uma pequena aldeia junto com uma companhia de bandidos. Mas há uma maldição na aldeia. Há muito tempo, a única filha do rei, Goldhair, desapareceu enquanto procurava pela Estrela de Natal. A rainha morreu de coração partido, deixando o rei despedaçado por conta própria. Daquele dia em diante, o rei amaldiçoou a Estrela de Natal, causando assim a escuridão e tristeza a descer sobre a terra. No entanto, um velho sábio revelou que Goldhair ainda está vivo e só retornará se o Rei encontrar o caminho de volta para a Estrela de Natal. Desde então, o rei tem procurado a Estrela de Natal todo Natal, mas tudo em vão.","first_air_date":"2012-11-09","runtime":80,"episode_run_time":[80],"vote_average":6.0,"created_by":["Moskus Film"],"production_companies":[{"name":"Moskus Film"}],"cast":["Vilde Zeiner","Anders Baasmo Christiansen","Agnes Kittelsen","Stig Werner Moe","Eilif Hellum Noraker"],"backdrop_path":"https://image.tmdb.org/t/p/original/A2owp1CjaOzAxnPwzQoovtJFBcT.jpg","poster_path":"https://image.tmdb.org/t/p/original/1oJwWkDn1anACQU5Z0r67m2AmDk.jpg","certification":"N/A","genres":["Fantasia","Aventura","Família"],"trailer":"N/A"},
