"77878":{"id":"77878","name":"Além da Liberdade","slug":"alem-da-liberdade","original_title":"The Lady","overview":"Filha de um herói da independência da Birmânia, Aung San Suu Kyi foi morar no exterior ainda jovem. Na Inglaterra se casou com Michael Aris e teve dois filhos, Kim e Alex, mantendo contato com o país através de livros publicados e o acompanhamento das notícias locais. Ao saber que sua mãe está internada em um hospital, Aung decide voltar à Birmânia para revê-la. Logo ao chegar ela é procurada por vários líderes locais, que desejam que ela coopere com o movimento pela implementação da democracia no país. Aung aceita o convite e, pouco a pouco, torna-se um ícone do movimento. A situação não agrada à ditadura militar local, que passa a acompanhar todos os seus passos e tenta impedi-la de promover manifestações. Até que, na esperança de fazer com que o povo se esqueça de Aung, o governo ordena que ela permaneça em prisão domiciliar por 15 anos.","first_air_date":"2011-11-30","runtime":132,"episode_run_time":[132],"vote_average":6.8,"created_by":["EuropaCorp","Left Bank Pictures","France 2 Cinéma"],"production_companies":[{"name":"EuropaCorp"},{"name":"Left Bank Pictures"},{"name":"France 2 Cinéma"}],"cast":["Michelle Yeoh","David Thewlis","Jonathan Raggett","Jonathan Woodhouse","Susan Wooldridge"],"backdrop_path":"https://image.tmdb.org/t/p/original/3Y3mUVlzXwChj62ScCOUqoQneLl.jpg","poster_path":"https://image.tmdb.org/t/p/original/lPNKaoKFZnS4ytbcZ8h4R4woUgK.jpg","certification":"14","genres":["Drama"],"trailer":"N/A"},
