"14543":{"id":"14543","name":"Matrix – Os Segredos de Produção","slug":"matrix-os-segredos-de-producao","original_title":"The Matrix Revisited","overview":"O documentário apresenta detalhes e curiosidades sobre a produção original e toda a trajetória de preparação para as filmagens. É mostrada a coleta de informações pelos diretores Larry e Andrew Wachowski sobre filosofia oriental e a natureza da realidade. Curiosidades como os diversos livros que Keanu Reeves teve de ler antes de conhecer o roteiro, além da influência de Hong Konge das lutas de kung-Fu sobre o filme são explicadas por meio de comentários da equipe e do elenco. Todos os mecanismos e táticas para a realização do filme são revelados no documentário. Vale dizer que a obra está dividida em tópicos para que os mistérios sejam esclarecidos: as locações dos sets na Austrália; o estilo visual; os figurinos; a criação dos efeitos especiais; o treinamento dos atores.","first_air_date":"2001-11-19","runtime":110,"episode_run_time":[110],"vote_average":6.8,"created_by":["Warner Bros. Pictures"],"production_companies":[{"name":"Warner Bros. Pictures"}],"cast":["Keanu Reeves","Hugo Weaving","Carrie-Anne Moss","Laurence Fishburne","Lorenzo di Bonaventura"],"backdrop_path":"https://image.tmdb.org/t/p/original/lBdXACywnLwKUZmZkZ87djDQBeV.jpg","poster_path":"https://image.tmdb.org/t/p/original/oNZK87GPiBPYfQnDJapungYlRyQ.jpg","certification":"N/A","genres":["Documentário"],"trailer":"N/A"},
