"560964":{"id":"560964","name":"Junglee - Protegendo a Selva","slug":"junglee-protegendo-a-selva","original_title":"जंगली","overview":"Dipankar Nair administra um santuário de elefantes, mas as coisas começam a ir mal, pois caçadores estão matando elefantes por causa do marfim das presas dos animais. Raj, filho de Nair, é um veterinário bem-sucedido em Mumbai. O rapaz chega ao santuário para o 10º aniversário da morte de sua mãe e faz amizade com os elefantes Bhola e Didi. Um caçador quer as presas de Bhola e para isso mata o animal, matando também Dipankar, que tentava salvar o elefante. Quando policiais chegam ao funeral, revelam que não só o falecido estava com os caçadores, como também Raj estaria envolvido. Perseguido, o veterinário agora terá que descobrir quem matou seu pai e ainda limpar o próprio nome da história.","first_air_date":"2019-03-29","runtime":114,"episode_run_time":[114],"vote_average":6.8,"created_by":["Junglee Pictures"],"production_companies":[{"name":"Junglee Pictures"}],"cast":["Vidyut Jammwal","Pooja Sawant","Asha Bhat","Atul Kulkarni","Makrand Deshpande"],"backdrop_path":"https://image.tmdb.org/t/p/original/64GBB3Qp1sG9AJZediJKEjUkUwI.jpg","poster_path":"https://image.tmdb.org/t/p/original/8SX0Yd6D6YFR3EyXlJmDoaKRwbL.jpg","certification":"12","genres":["Ação","Aventura"],"trailer":"qcbT3-iPixw"},
