"30618":{"id":"30618","name":"Uma Cidade Sem Lei","slug":"uma-cidade-sem-lei","original_title":"Bunraku","overview":"Como consequência de uma guerra global, as armas de fogo foram proibidas, mas nesta cidade a violência continua muito forte, controlada por Nicola (Ron Perlman) e seu exercíto de noves guerreiros, chamados, The Killers. Um de seus guerreiros é Alexandra (Demi Moore), uma sedutora mulher que possui um passado secreto. Os habitantes da cidade vivem com medo da gangue de Nicola e esperam que um herói os salve. É quando chega o misterioso Drifter (Josh Hartnett), que chega à cidade a procura de vingança e irá se encontrar em um grande desafio.","first_air_date":"2010-09-01","runtime":124,"episode_run_time":[124],"vote_average":5.9,"created_by":["Picturesque Films","Outpost Studios","Snoot Entertainment","Ram Bergman Productions"],"production_companies":[{"name":"Picturesque Films"},{"name":"Outpost Studios"},{"name":"Snoot Entertainment"},{"name":"Ram Bergman Productions"}],"cast":["Josh Hartnett","Demi Moore","Woody Harrelson","Ron Perlman","GACKT"],"backdrop_path":"https://image.tmdb.org/t/p/original/n55bDZJxKxMqCew6fDHul1kpXfN.jpg","poster_path":"https://image.tmdb.org/t/p/original/AszMrQlR11YhWliYgSqbN83Prni.jpg","certification":"N/A","genres":["Thriller","Ação","Drama"],"trailer":"N/A"},
"432602":{"id":"432602","name":"Uma Verdade Mais Inconveniente","slug":"uma-verdade-mais-inconveniente","original_title":"An Inconvenient Sequel: Truth to Power","overview":"Dez anos após \"Uma Verdade Inconveniente\" ter alertado sobre a necessidade da união entre países para tratar a crise iminente envolvendo o aquecimento global, Al Gore retorna ao tema para mostrar não apenas as consequências práticas da crise climática, mas também os avanços obtidos na obtenção de energia através de fontes limpas.","first_air_date":"2017-07-28","runtime":98,"episode_run_time":[98],"vote_average":6.6,"created_by":["Participant","Actual Films"],"production_companies":[{"name":"Participant"},{"name":"Actual Films"}],"cast":["Al Gore","Barack Obama","Donald Trump","Angela Merkel","Justin Trudeau"],"backdrop_path":"https://image.tmdb.org/t/p/original/9trJj4yG18FGT29pPnUjtJd2ouq.jpg","poster_path":"https://image.tmdb.org/t/p/original/cF6ko5YUPIJaU47ql8eBbJBoDfB.jpg","certification":"10","genres":["Documentário"],"trailer":"N/A"},
