"103686":{"id":"103686","name":"Paraíso: Amor","slug":"paraiso-amor","original_title":"Paradies: Liebe","overview":"Teresa, mulher dos seus cinquenta anos, austríaca, embarca de férias para um hotel de praia no Quênia, assim como milhares de europeus fazem. Muitas mulheres vão para lá à procura de sexo com os negros locais. Teresa deseja sexo, como as amigas, mas gostaria de um pouco de atenção, por se sentir velha, gorda e mal amada. Alguns homens ali até parecem querer dar esse amor a Teresa. Mas nesse meio de prostituição e exploração, precisamos saber, realmente, quem explora e quem é explorado.","first_air_date":"2012-04-27","runtime":121,"episode_run_time":[121],"vote_average":6.8,"created_by":["Société Parisienne de Production","Ulrich Seidl Filmproduktion","Tatfilm"],"production_companies":[{"name":"Société Parisienne de Production"},{"name":"Ulrich Seidl Filmproduktion"},{"name":"Tatfilm"}],"cast":["Margarethe Tiesel","Peter Kazungu","Inge Maux","Dunja Sowinetz","Helen Brugat"],"backdrop_path":"https://image.tmdb.org/t/p/original/9jmlny93dxtXn4KnjGlj8sUsL20.jpg","poster_path":"https://image.tmdb.org/t/p/original/a0EKFhdCJRfsySrakjnVVehq2gG.jpg","certification":"N/A","genres":["Drama"],"trailer":"N/A"},
"520466":{"id":"520466","name":"Pânico No Lago: O Legado","slug":"panico-no-lago-o-legado","original_title":"Lake Placid: Legacy","overview":"Legacy descobre a equipe de jovens exploradores para revelar os segredos de uma área removida dos mapas modernos e escondida atrás de cercas elétricas. No entanto, uma vez que eles chegam ao centro do lago, eles descobrem uma ilha que abriga uma instalação abandonada com um legado horrível: a ilha é o lar de um predador mortal ansioso para se divertir com aqueles idiotas o suficiente para ignorar os avisos. Mas antes que eles possam voltar atrás, nossos infelizes heróis são arrastados para uma batalha por suas vidas - e precisarão trabalhar juntos se quiserem sobreviver.","first_air_date":"2018-05-28","runtime":93,"episode_run_time":[93],"vote_average":5.1,"created_by":["Out of Africa Entertainment","Blue Ice Pictures"],"production_companies":[{"name":"Out of Africa Entertainment"},{"name":"Blue Ice Pictures"}],"cast":["Katherine Barrell","Tim Rozon","Luke Newton","Craig Stein","Greg Kriek"],"backdrop_path":"https://image.tmdb.org/t/p/original/3rIocL2KDm8d2sCVmqDI0IEK2vF.jpg","poster_path":"https://image.tmdb.org/t/p/original/jMQBRaMoktWm46uIUYKeOHWXXxe.jpg","certification":"16","genres":["Terror","Ação","Ficção científica","Cinema TV"],"trailer":"N/A"},
