"41579":{"id":"41579","name":"Acertando as Contas com Papai","slug":"acertando-as-contas-com-papai","original_title":"Getting Even with Dad","overview":"Ray Gleason (Ted Danson),um ex-condenado e viúvo, decide roubar moedas avaliadas em um milhão e meio de dólares justamente quando Timmy (Macaulay Culkin), seu filho que morava com Kitty (Kathleen Wilhoite), sua tia, volta para casa, pois ela está em lua-de-mel. Após o roubo ter sido efetuado Timmy rouba o pai e diz que só devolve as moedas se eles se divertirem um pouco juntos e recuperarem parte do tempo perdido. Mas Timmy também tenta evitar que Ray comercialize as moedas com um receptador, pois acredita que ao tentar fazê-lo seu pai será preso.","first_air_date":"1994-06-17","runtime":109,"episode_run_time":[109],"vote_average":5.3,"created_by":["Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Metro-Goldwyn-Mayer"}],"cast":["Macaulay Culkin","Ted Danson","Glenne Headly","Saul Rubinek","Gailard Sartain"],"backdrop_path":"https://image.tmdb.org/t/p/original/570uxNdyVeeeEQ8Hi8R0tFJPomJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/tNv8kmmouFqNlO9y30qwfO3RlmQ.jpg","certification":"N/A","genres":["Comédia","Crime","Família"],"trailer":"N/A"},
