"2255":{"id":"2255","name":"Procura-se Amy","slug":"procura-se-amy","original_title":"Chasing Amy","overview":"Holden McNeil e Banky Edwards, criadores de uma famosa revista em quadrinhos em Nova Jérsia, vivem tranquilos, até Holden conhecer a bela roteirista Alyssa Jones. Apaixonado pela garota, sente-se traído ao descobrir suas preferências românticas. Decidem ser só bons amigos. Depois de uma proposta inusitada, Alyssa e Holden se separam e só se reencontram um ano depois...","first_air_date":"1997-04-04","runtime":113,"episode_run_time":[113],"vote_average":6.8,"created_by":["View Askew Productions","Miramax"],"production_companies":[{"name":"View Askew Productions"},{"name":"Miramax"}],"cast":["Ben Affleck","Joey Lauren Adams","Jason Lee","Dwight Ewell","Jason Mewes"],"backdrop_path":"https://image.tmdb.org/t/p/original/t2y702RwMBOqZLtKxSJn0zaNtl.jpg","poster_path":"https://image.tmdb.org/t/p/original/4JnnGazTO3YfThikKvBxA7zpZH0.jpg","certification":"N/A","genres":["Comédia","Drama","Romance"],"trailer":"N/A"},
"38171":{"id":"38171","name":"Anastacia: A Princesa Esquecida","slug":"anastacia-a-princesa-esquecida","original_title":"Anastasia","overview":"Com a revolução russa em 1917, o Czar Nicolau II e sua família foram capturados e executados, mas segundo rumores, sua filha mais nova Anastácia havia sobrevivido e vivia na Europa. Anos depois, um ex-general russo, que vive de um empreendimento fraudulento envolvendo a herança real, precisa provar aos seus investidores a existência da princesa, e se utiliza de uma mulher perturbada e sem identidade para assumir o papel de Anastácia.","first_air_date":"1956-12-13","runtime":105,"episode_run_time":[105],"vote_average":6.8,"created_by":["20th Century Fox"],"production_companies":[{"name":"20th Century Fox"}],"cast":["Ingrid Bergman","Yul Brynner","Helen Hayes","Akim Tamiroff","Martita Hunt"],"backdrop_path":"https://image.tmdb.org/t/p/original/z29SCOPlLUX8NkmofgFnuTH9OyK.jpg","poster_path":"https://image.tmdb.org/t/p/original/ungEYe0IVnGYZeuIZccsAmu1rwV.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
"589594":{"id":"589594","name":"Abdução","slug":"abducao","original_title":"Abduction","overview":"Quinn é um agente americano que acorda no Vietnã mais de uma década à frente do ano em que pensava estar. Ele então inicia uma investigação e acaba tendo flashes do sequestro de sua filha. É quando ele conhece o ex-agente Connor que está à procura de sua esposa. Os dois logo se unem para solucionar o mistério, mas acabam encontrando uma força extraterrestre com planos maiores para a Terra.","first_air_date":"2019-03-20","runtime":98,"episode_run_time":[98],"vote_average":5.9,"created_by":["Red Sea Media","Ace Films"],"production_companies":[{"name":"Red Sea Media"},{"name":"Ace Films"}],"cast":["Scott Adkins","安志傑","Lily Ji","Aki Aleong","Trương Ngọc Ánh"],"backdrop_path":"https://image.tmdb.org/t/p/original/tv0w5IaY3nHScDRleV61ZRRpWND.jpg","poster_path":"https://image.tmdb.org/t/p/original/oBlOPZnyOzIboyhjs51h2QGpWr8.jpg","certification":"16","genres":["Terror","Ficção científica","Thriller","Ação"],"trailer":"N/A"},
"9930":{"id":"9930","name":"Perigosamente Juntos","slug":"perigosamente-juntos","original_title":"Legal Eagles","overview":"Um assistente da promotoria pública é designado para processar a filha de um famoso artista, acusada de ter roubado uma das pinturas de seu falecido pai. Mas ele se defronta com uma excêntrica advogada, que não utiliza métodos costumeiros para vencer seus casos. Em virtude de determinados fatos o promotor inicial passa a atuar na defesa.","first_air_date":"1986-06-18","runtime":116,"episode_run_time":[116],"vote_average":6.1,"created_by":["Northern Lights Entertainment","Universal Pictures","Mirage Enterprises"],"production_companies":[{"name":"Northern Lights Entertainment"},{"name":"Universal Pictures"},{"name":"Mirage Enterprises"}],"cast":["Robert Redford","Debra Winger","Daryl Hannah","Brian Dennehy","Terence Stamp"],"backdrop_path":"https://image.tmdb.org/t/p/original/kL9mUbw8QJBh1vz643o956XZ0uj.jpg","poster_path":"https://image.tmdb.org/t/p/original/Ah4Tod3PzLFz7gNAl4KQAkG75JJ.jpg","certification":"12","genres":["Comédia","Crime"],"trailer":"N/A"},
"12651":{"id":"12651","name":"Memphis Belle - A Fortaleza Voadora","slug":"memphis-belle-a-fortaleza-voadora","original_title":"Memphis Belle","overview":"Um grupo de jovens tripulantes da segunda guerra mundial, liderados por Matthew Modine e Eric Stoltz, saiu ileso de 24 perigosas missões num avião B-17, também conhecido como \"Memphis Belle\". Mas ainda falta uma última e quase suicida missão para eles voltarem como verdadeiros heróis: Bombardear Dresden, uma cidade fortemente defendida que invariavelmente causa muitas baixas, na Alemanha de Hitler, em plena luz do dia. É este emocionante episódio verídico que inspirou David Puttnam e Catherine Wyler a realizarem este filme, mostrando as dúvidas, incertezas e determinação de jovens que resolveram desafiar o perigo dos céus.","first_air_date":"1990-09-07","runtime":107,"episode_run_time":[107],"vote_average":6.7,"created_by":["Warner Bros. Pictures","Enigma Productions","Fujisankei Communications Group","British Satellite Broadcasting","NatWest Ventures","The Bountiful Company"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Enigma Productions"},{"name":"Fujisankei Communications Group"},{"name":"British Satellite Broadcasting"},{"name":"NatWest Ventures"},{"name":"The Bountiful Company"}],"cast":["Matthew Modine","Eric Stoltz","Tate Donovan","D. B. Sweeney","Billy Zane"],"backdrop_path":"https://image.tmdb.org/t/p/original/8kVhN0OC5AmdHJJ1BxKCakZhvQO.jpg","poster_path":"https://image.tmdb.org/t/p/original/6GFpgWWcc6RWrcjrRudIXSLvPuF.jpg","certification":"N/A","genres":["Drama","Guerra","Ação"],"trailer":"N/A"},
