"17768":{"id":"17768","name":"Um Escravo das Arábias em Roma","slug":"um-escravo-das-arabias-em-roma","original_title":"A Funny Thing Happened on the Way to the Forum","overview":"Um escravo astuto deve unir uma cortesã virgem e seu jovem mestre apaixonado para ganhar sua liberdade. Pseudolus é o escravo mais preguiçoso de Roma e tem apenas um desejo: comprar sua liberdade. Quando seu mestre e sua amante saem para o dia, ele descobre que o jovem mestre se apaixonou por uma virgem da casa de Lico, um traficante de escravos especializado em mulheres bonitas. Pseudolus inventa um acordo em que ele será libertado se puder adquirir a garota para o jovem herói. É claro que não pode ser tão simples assim quando tudo começa a dar errado. (e 12 - Estimado 12 Anos)","first_air_date":"1966-10-16","runtime":99,"episode_run_time":[99],"vote_average":6.0,"created_by":["United Artists","Melvin Frank Productions"],"production_companies":[{"name":"United Artists"},{"name":"Melvin Frank Productions"}],"cast":["Zero Mostel","Jack Gilford","Phil Silvers","Buster Keaton","Michael Crawford"],"backdrop_path":"https://image.tmdb.org/t/p/original/hzamEWW4VPo5RMCxKWGAwZDr1tE.jpg","poster_path":"https://image.tmdb.org/t/p/original/h3S9DZMUZNsAqd8ZNBed7ttPWXk.jpg","certification":"N/A","genres":["Música","Comédia","Romance"],"trailer":"N/A"},
"11973":{"id":"11973","name":"13 Dias Que Abalaram o Mundo","slug":"13-dias-que-abalaram-o-mundo","original_title":"Thirteen Days","overview":"Durante treze extraordinários dias em outubro de 1962, o mundo esteve à beira de uma verdadeira catástrofe. Todo o planeta aguardava com ansiedade o desfecho do confronto político-militar entre Estados Unidos e União Soviética em razão da instalação de mísseis antiaéreos soviéticos em Cuba. O confronto foi tão sério que quase provocou uma guerra nuclear entre as duas potências, o que poderia ter destruído toda a humanidade. O alarmante desenvolvimento dos eventos ocorridos durante esses treze dias envolveu um número enorme de políticos, militares e gente influente que temiam uma invasão russa através do estabelecimento da base militar em Cuba. A ação se passa quase que em sua totalidade dentro da Casa Branca, onde discussões acaloradas e intermináveis sobre como encaminhar a questão do armamento de Cuba com o então poderoso governo da União Soviética consumiam os dias dos políticos e, principalmente, do presidente e seus dois fiéis confidentes e amigos.","first_air_date":"2000-12-25","runtime":145,"episode_run_time":[145],"vote_average":7.0,"created_by":["New Line Cinema","Beacon Pictures"],"production_companies":[{"name":"New Line Cinema"},{"name":"Beacon Pictures"}],"cast":["Kevin Costner","Bruce Greenwood","Steven Culp","Dylan Baker","Michael Fairman"],"backdrop_path":"https://image.tmdb.org/t/p/original/pR3v192B20nFtsHY1jZQS4AkN0a.jpg","poster_path":"https://image.tmdb.org/t/p/original/sZFsobB9BAPWXA07bwag7wwHfvG.jpg","certification":"12","genres":["História","Thriller"],"trailer":"N/A"},
