"9722":{"id":"9722","name":"A Feiticeira","slug":"a-feiticeira","original_title":"Bewitched","overview":"Isabel (Nicole Kidman) é uma bondosa bruxa, que vive no vale californiano de San Fernando e deseja mudar de vida. Isabel está decidida a renegar seus poderes sobrenaturais e levar uma vida normal. Enquanto isso Jack Wyatt (Will Ferrell), um ator que deseja resgatar sua carreira, se dedica integralmente à nova versão da clássica série de TV \"A Feiticeira\", exibida nos anos 60, na qual interpretará o personagem Darrin. Por acaso Jack conhece Isabel, por quem sente uma atração imediata. Convencido de que Isabel poderia interpretar a personagem Samantha na série, Jack a convence a se tornar atriz. Por sua vez Isabel vê em Jack a chance de levar uma vida normal, sem precisar usar seus poderes, e por isso aceita o papel.","first_air_date":"2005-06-21","runtime":102,"episode_run_time":[102],"vote_average":5.1,"created_by":["Bewitched","Red Wagon Entertainment","Columbia Pictures","Columbia Pictures Television"],"production_companies":[{"name":"Bewitched"},{"name":"Red Wagon Entertainment"},{"name":"Columbia Pictures"},{"name":"Columbia Pictures Television"}],"cast":["Nicole Kidman","Will Ferrell","Shirley MacLaine","Michael Caine","Jason Schwartzman"],"backdrop_path":"https://image.tmdb.org/t/p/original/vBVRgryngFoqHazyLqFca6xNTeB.jpg","poster_path":"https://image.tmdb.org/t/p/original/npz3nxmaI2TspQkVoGobgdUdO36.jpg","certification":"N/A","genres":["Comédia","Fantasia","Romance"],"trailer":"N/A"},
