"10612":{"id":"10612","name":"O Inglês que Subiu a Colina e Desceu a Montanha","slug":"o-ingles-que-subiu-a-colina-e-desceu-a-montanha","original_title":"The Englishman Who Went Up a Hill But Came Down a Mountain","overview":"Quando uma dupla de cartógrafos Ingleses, Anson e Garrad, deve dizer aos moradores de uma aldeia galesa que sua montanha é apenas uma colina, a comunidade de Fynnon Garw fica extremamente ofendida. E se propõe a mudar isso. Em 1917 uma dupla de cartógrafos militares Ingleses, Reginald Anson (Hugh Grant) e George Garrad (Ian McNeice), está percorrendo o País de Gales fazendo medições da altura de diversas elevações para o novo mapa que o governo Britânico encomendou. E acabam chegando ao povoado de Fynnon Garw cuja pequena população tem muito orgulho de sua \"Montanha\". Porém após as primeiras medições verificam que a \"Montanha\" não atinge os 1.000 pés necessários para ter esse título. E devem dizer aos moradores da aldeia galesa que sua \"Montanha\" é apenas uma colina. A comunidade ofendida se propõe a mudar isso.","first_air_date":"1995-05-12","runtime":99,"episode_run_time":[99],"vote_average":6.3,"created_by":["Miramax","Parallax Pictures"],"production_companies":[{"name":"Miramax"},{"name":"Parallax Pictures"}],"cast":["Hugh Grant","Tara Fitzgerald","Colm Meaney","Ian McNeice","Ian Hart"],"backdrop_path":"https://image.tmdb.org/t/p/original/wY1Rn2DnmDt7QKnGSH5be3JM7u7.jpg","poster_path":"https://image.tmdb.org/t/p/original/k1lAPq5hTCo8bH2aakoYFur9ePC.jpg","certification":"Livre","genres":["Drama","Comédia","Romance"],"trailer":"N/A"},
