"300153":{"id":"300153","name":"Life: Um Retrato de James Dean","slug":"life-um-retrato-de-james-dean","original_title":"Life","overview":"Às vésperas do lançamento do filme \"Vidas Amargas\" (1955), James Dean ainda não é um ator famoso. Os estúdios têm grandes planos para transformá-lo em um astro, mas ele não se sente à vontade com a vida de festas, eventos e autógrafos. O fotógrafo Dennis Stock, apostando no sucesso iminente de James Dean, pede para fotografá-lo em um ensaio para a revista Life, mas recebe apenas respostas negativas. Um dia, para fugir da promoção de \"Vidas Amargas\", Dean esconde-se na fazenda de sua família, e leva o novo amigo Stock junto dele. Neste local, o fotógrafo registra as imagens mais famosas de toda a carreira do ator.","first_air_date":"2015-09-09","runtime":112,"episode_run_time":[112],"vote_average":6.0,"created_by":["See-Saw Films","Barry Films","First Generation Films","Film4 Productions"],"production_companies":[{"name":"See-Saw Films"},{"name":"Barry Films"},{"name":"First Generation Films"},{"name":"Film4 Productions"}],"cast":["Robert Pattinson","Dane DeHaan","Joel Edgerton","Ben Kingsley","Kelly McCreary"],"backdrop_path":"https://image.tmdb.org/t/p/original/xq41fcgtkJgorfMPNseNY9lZ25i.jpg","poster_path":"https://image.tmdb.org/t/p/original/j9rOxjGVSdTTJwyMdGGTEusPxbM.jpg","certification":"14","genres":["Drama"],"trailer":"IV5eemoiUhA"},
