"9045":{"id":"9045","name":"Amém","slug":"amem","original_title":"Amen.","overview":"Kurt Gerstein (Ulrich Tukur) é um oficial do Terceiro Reich que trabalhou na elaboração do Zyklon B, gás mortífero originalmente desenvolvido para a matança de animais mas usado para exterminar milhares de judeus durante a 2ª Guerra Mundial. Gerstein se revolta com o que testemunha e tenta informar os aliados sobre as atrocidades nos campos de concentração. Católico, busca chamar a atenção do Vaticano, mas suas denúncias são ignoradas pelo alto clero. Apenas um jovem jesuíta lhe dá ouvidos e o ajuda a organizar uma campanha para que o Papa (Marcel Iures) quebre o silêncio e se manifeste contra as violências ocorridas em nome de uma suposta supremacia racial.","first_air_date":"2002-02-27","runtime":132,"episode_run_time":[132],"vote_average":7.0,"created_by":["K.G. Productions","KC Medien","Katharina","Renn Productions","Canal+","TF1 Films Production"],"production_companies":[{"name":"K.G. Productions"},{"name":"KC Medien"},{"name":"Katharina"},{"name":"Renn Productions"},{"name":"Canal+"},{"name":"TF1 Films Production"}],"cast":["Ulrich Tukur","Mathieu Kassovitz","Ulrich Mühe","Michel Duchaussoy","Marcel Iureș"],"backdrop_path":"https://image.tmdb.org/t/p/original/dHjb0duA8MwjiMJykF7dLcEoKBm.jpg","poster_path":"https://image.tmdb.org/t/p/original/9xAPyYXWw7UPub2eO3FNtcCK7lI.jpg","certification":"N/A","genres":["Drama","História"],"trailer":"N/A"},
"574638":{"id":"574638","name":"Rolling Thunder Revue: A Bob Dylan Story by Martin Scorsese","slug":"rolling-thunder-revue-a-bob-dylan-story-by-martin-scorsese","original_title":"Rolling Thunder Revue: A Bob Dylan Story by Martin Scorsese","overview":"Em 1975, Bob Dylan embarcou em uma turnê através dos Estados Unidos junto com diversos artistas, brincando com novas técnicas criativas e adotando uma teatralidade raramente vista em sua carreira. Unindo imagens de arquivo restauradas e novas entrevistas com Dylan, o diretor Martin Scorsese captura a experiência desse momento histórico tanto para a música, quanto para o espírito americano.","first_air_date":"2019-06-11","runtime":142,"episode_run_time":[142],"vote_average":7.1,"created_by":["Grey Water Park Productions","Sikelia Productions"],"production_companies":[{"name":"Grey Water Park Productions"},{"name":"Sikelia Productions"}],"cast":["Bob Dylan","Allen Ginsberg","Patti Smith","Martin von Haselberg","Scarlet Rivera"],"backdrop_path":"https://image.tmdb.org/t/p/original/4MYtYsSGzQUUYQqHGWBNeEkT91s.jpg","poster_path":"https://image.tmdb.org/t/p/original/ixxELBgYj9OH8hz0XCrcZOJpIx9.jpg","certification":"N/A","genres":["Documentário","Música"],"trailer":"N/A"},
"10269":{"id":"10269","name":"Yentl","slug":"yentl","original_title":"Yentl","overview":"Após a morte do seu pai, Yentl (Barbra Streisand) só tem uma ambição na vida: ir para a faculdade e estudar. Mas, naquela época, o lugar de uma mulher era em casa, e estudar era coisa para homens. Yentl então arriscava tudo em nome da paixão insaciável pelo estudo: finge que é homem, ingressa na universidade e realiza o seu desejo proibido. Mas, em um lugar onde até a mente mais determinada pode ser traída pelo corpo, por quanto tempo Yentl será capaz de manter seu segredo bem guardado dos seus novos amigos e do rapaz por quem se apaixonou?","first_air_date":"1983-11-18","runtime":132,"episode_run_time":[132],"vote_average":6.7,"created_by":["Ladbroke","United Artists","Barwood Films","Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Ladbroke"},{"name":"United Artists"},{"name":"Barwood Films"},{"name":"Metro-Goldwyn-Mayer"}],"cast":["Barbra Streisand","Mandy Patinkin","Amy Irving","Nehemiah Persoff","Steven Hill"],"backdrop_path":"https://image.tmdb.org/t/p/original/oMRr5B0OkOJ8vjwR2w5Xw7YNp9W.jpg","poster_path":"https://image.tmdb.org/t/p/original/4pxpLRvtoJrFQqXhQsHgPrLE0SC.jpg","certification":"N/A","genres":["Música","Drama","Romance"],"trailer":"N/A"},
