"17897":{"id":"17897","name":"As Novas Viagens de Simbad","slug":"as-novas-viagens-de-simbad","original_title":"The Golden Voyage of Sinbad","overview":"Esta é uma espetacular aventura passada nas misteriosas terras antigas, habitadas por incríveis criaturas! Simbad (John Phillip Law) - Príncipe de Bagdá e lendário marinheiro - acha um intrigante mapa e sai em busca da desconhecida ilha de Lemuria, levando a bela escrava Margiana (Caroline Muron) e o Grão Vizir de Marabia. O Príncipe Koura (Tom Baker), um maligno feiticeiro que tenta obter o controle de Marabia com a manipulação de espíritos do mal, segue-os para impedir o sucesso de Simbad. Mas o marinheiro encontra Lemuria a despeito dos terríveis feitiços lançados por Koura em seu caminho. Em Lemuria, Simbad e sua corajosa tripulção lutam contra uma estátua de seis espadas, um centauro de um olho só e um Grifo, fabuloso animal com cabeça de águia e garras de leão. Finalmente Simbad confronta-se a Koura, num duelo de vida e morte!","first_air_date":"1973-12-20","runtime":105,"episode_run_time":[105],"vote_average":6.7,"created_by":["Columbia Pictures","Morningside Productions"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Morningside Productions"}],"cast":["John Phillip Law","Caroline Munro","Tom Baker","Douglas Wilmer","Martin Shaw"],"backdrop_path":"https://image.tmdb.org/t/p/original/izHLxrSRlATwwHFGe6eKQobGWlb.jpg","poster_path":"https://image.tmdb.org/t/p/original/u5zqjQU11iMahUi0byL4drE27tN.jpg","certification":"N/A","genres":["Ação","Aventura","Drama","Fantasia","Família"],"trailer":"N/A"},
