"1770":{"id":"1770","name":"Michael Collins: O Preço da Liberdade","slug":"michael-collins-o-preco-da-liberdade","original_title":"Michael Collins","overview":"Em 1916, na Irlanda, Michael Collins é preso em virtude de participar de uma manifestação contra a presença inglesa em seu país. É neste período que ele passa a acreditar que a guerrilha poderá levar seus compatriotas ao fim de uma submissão ao governo inglês, que dura 700 anos. Assim é criado o Exército Republicano Irlandês, o IRA, conseguindo em 1921 realizar o primeiro acordo de paz com os ingleses, quando fundou a República da Irlanda do Norte. Mas a paz almejada foi apenas o início de um conflito entre Irlanda do Norte e Inglaterra, que permanece até os dias de hoje.","first_air_date":"1996-10-25","runtime":132,"episode_run_time":[132],"vote_average":6.9,"created_by":["Geffen Pictures","Warner Bros. Pictures"],"production_companies":[{"name":"Geffen Pictures"},{"name":"Warner Bros. Pictures"}],"cast":["Liam Neeson","Aidan Quinn","Stephen Rea","Alan Rickman","Julia Roberts"],"backdrop_path":"https://image.tmdb.org/t/p/original/hZQE3YIoajSFtqkvSZCTnvISIMl.jpg","poster_path":"https://image.tmdb.org/t/p/original/brIBbU6t9glEGAKRTJ4PMj9OiDC.jpg","certification":"12","genres":["Guerra","Drama","Thriller","História"],"trailer":"N/A"},
