"20227":{"id":"20227","name":"Michael Jackson Live In Bucharest: The Dangerous Tour","slug":"michael-jackson-live-in-bucharest-the-dangerous-tour","original_title":"Michael Jackson: Live in Bucharest - The Dangerous Tour","overview":"Live in Bucharest: The Dangerous Tour é um concerto ao vivo ocorrido em 01/10/1992 lançado em DVD por Michael Jackson em 2005. O DVD foi anteriormente incluído no box Michael Jackson: The Ultimate Collection. O concerto teve lugar durante a primeira parte do Dangerous World Tour em 1 de outubro de 1992 no Estádio Lia Manoliu, com lotação esgotada e o comparecimento de 100.000 pessoas. Este concerto é um dos shows de Michael que foram lançados em DVD, junto com a Bad World Tour com o DVD Michael Jackson Live At Wembley 16.07.1988 e a HIStory World Tour em Seul, que foi lançado em VHS na Coreia do Sul. Estes concertos são os únicos que foram oficialmente lançados.","first_air_date":"1992-10-02","runtime":122,"episode_run_time":[122],"vote_average":8.6,"created_by":["Optimum Productions","Epic Records","Sony BMG Music Entertainment","HBO","BBC"],"production_companies":[{"name":"Optimum Productions"},{"name":"Epic Records"},{"name":"Sony BMG Music Entertainment"},{"name":"HBO"},{"name":"BBC"}],"cast":["Michael Jackson","Siedah Garrett","David Williams","Jennifer Batten","Don Boyette"],"backdrop_path":"https://image.tmdb.org/t/p/original/rPWfZW0494nkLkXEhd5WjvWcsj3.jpg","poster_path":"https://image.tmdb.org/t/p/original/fojSl7uLpxE6YCPVvtMG8e0I6Uo.jpg","certification":"N/A","genres":["Música"],"trailer":"N/A"},
