"773975":{"id":"773975","name":"Fim da Estrada","slug":"fim-da-estrada","original_title":"End of the Road","overview":"Depois de ficar viúva e perder o emprego, Brenda atravessa o país com a família para recomeçar a vida. No deserto do Novo México, longe de qualquer possibilidade de ajuda, eles viram alvos de uma perseguição mortal e precisam aprender a se defender.","first_air_date":"2022-09-09","runtime":89,"episode_run_time":[89],"vote_average":6.0,"created_by":["Edmonds Entertainment Group","Mark Burg Productions"],"production_companies":[{"name":"Edmonds Entertainment Group"},{"name":"Mark Burg Productions"}],"cast":["Queen Latifah","Ludacris","Mychala Lee","Shaun Dixon","Beau Bridges"],"backdrop_path":"https://image.tmdb.org/t/p/original/5luJmy21N3bYCkjzRHsoZfvLtPP.jpg","poster_path":"https://image.tmdb.org/t/p/original/aqUTMmzAmNgmr55U1dezPVTQAHP.jpg","certification":"N/A","genres":["Drama","Thriller"],"trailer":"N/A"},
"15907":{"id":"15907","name":"Duma","slug":"duma","original_title":"Duma","overview":"Seu grande amigo e guarda-costas é um guepardo. Mas agora é hora de devolver o grande felino à vida selvagem. Tendo como cenário as belas paisagens da África. “Duma” é uma poderosa história de aventura sobre os inquebrantáveis laços de amizade entre um guepardo chamado Duma e um garotinho chamado Xan. Apesar dos poucos 12 anos de idade, Xan terá que enfrentar uma verdadeira prova de amor ao encarar uma expedição que irá cruzar o sul da África a fim de devolver seu melhor amigo à sua verdadeira casa: a natureza.","first_air_date":"2005-04-22","runtime":100,"episode_run_time":[100],"vote_average":7.3,"created_by":["Pandora Pictures","Gaylord Films","John Wells Productions","Warner Bros. Pictures"],"production_companies":[{"name":"Pandora Pictures"},{"name":"Gaylord Films"},{"name":"John Wells Productions"},{"name":"Warner Bros. Pictures"}],"cast":["Alex Michaeletos","Campbell Scott","Mary Makhatho","Nthabiseng Kenoshi","Hope Davis"],"backdrop_path":"https://image.tmdb.org/t/p/original/nGd0NNJSXMVwCGvWcVmp0pMd8uo.jpg","poster_path":"https://image.tmdb.org/t/p/original/opoDxQW9S6SaiP8rY7urw16QVTL.jpg","certification":"N/A","genres":["Aventura","Drama","Família"],"trailer":"N/A"},
"319373":{"id":"319373","name":"Sabor da Vida","slug":"sabor-da-vida","original_title":"あん","overview":"Sentaro dirige uma pequena padaria que serve dorayakis - panquecas recheadas com pasta de feijão vermelho doce. Quando uma senhora de idade, Tokue, se oferece para ajudar na cozinha, ele relutantemente aceita. Mas Tokue prova ter um toque de mágica quando se trata de fazer “an”. Graças à sua receita secreta, o pequeno negócio logo floresce e com o tempo, Sentaro e Tokue abrem seus corações para revelar velhas feridas.","first_air_date":"2015-05-30","runtime":113,"episode_run_time":[113],"vote_average":7.4,"created_by":["Aeon Entertainment","The Asahi Shimbun"],"production_companies":[{"name":"Aeon Entertainment"},{"name":"The Asahi Shimbun"}],"cast":["Kirin Kiki","永瀬正敏","Kyara Uchida","水野美紀","市原悦子"],"backdrop_path":"https://image.tmdb.org/t/p/original/bFMUmg1J47I8bCjPXpYEeuNgRkv.jpg","poster_path":"https://image.tmdb.org/t/p/original/qkMp62rpUIXFmFSX4gldkiZiQzO.jpg","certification":"N/A","genres":["Drama"],"trailer":"gVXi0vB7H-M"},
