"10188":{"id":"10188","name":"Quatro Amigas e um Jeans Viajante 2","slug":"quatro-amigas-e-um-jeans-viajante-2","original_title":"The Sisterhood of the Traveling Pants 2","overview":"Depois que as quatro amigas terminaram o colégio, cada uma toma um rumo diferente na vida, e já não estão mais sempre juntas como costumavam estar. Apesar das mudanças em suas vidas, elas vão precisar uma da outra para superar alguns problemas pessoais. Lena (Alexis Bledel) sofre com os desencontros amorosos, Tibby (Amber Tamblyn) tem medo de se entregar as pessoas e à felicidade, Bridget (Blake Lively) passa por conflitos familiares e Carmen (America Ferrera) enfrenta mais mudanças em sua vida. Para se somar a isso, quem sofre com o descaso das meninas é a calça da Irmandade, que elas perdem. Mais uma vez a calça vai unir as garotas, que se juntarão para procurá-la.","first_air_date":"2008-08-06","runtime":117,"episode_run_time":[117],"vote_average":6.3,"created_by":["Alcon Entertainment","Di Novi Pictures","Alloy Entertainment"],"production_companies":[{"name":"Alcon Entertainment"},{"name":"Di Novi Pictures"},{"name":"Alloy Entertainment"}],"cast":["Amber Tamblyn","America Ferrera","Blake Lively","Alexis Bledel","Rachel Nichols"],"backdrop_path":"https://image.tmdb.org/t/p/original/kF1n2SZf1eRCQRipExHrQJhtDWn.jpg","poster_path":"https://image.tmdb.org/t/p/original/8oHzMzUoD7GHuFOB5lWjkwzGsn5.jpg","certification":"N/A","genres":["Aventura","Comédia","Drama"],"trailer":"N/A"},
