"144340":{"id":"144340","name":"A Seleção","slug":"a-selecao","original_title":"Admission","overview":"Portia Nathan trabalha no escritório de candidaturas da prestigiosa universidade de Princeton, onde está prestes a conseguir uma grande promoção. Um dia, o velho amigo John Pressman convida-a a visitar a escola colegial onde ele trabalha, no intuito de conhecer Jeremiah, um candidato em potencial à universidade. Chegando no local, John revela sua real intenção com o convite: ele suspeita que o garoto seja o filho que Portia entregou à adoção. Intrigada com essa possibilidade, ela põe sua carreira em perigo para se aproximar de Jeremiah e reatar com o seu passado.","first_air_date":"2013-03-21","runtime":107,"episode_run_time":[107],"vote_average":5.6,"created_by":["Focus Features","Depth of Field"],"production_companies":[{"name":"Focus Features"},{"name":"Depth of Field"}],"cast":["Tina Fey","Ann Harada","Ben Levin","Dan Levy","Maggie Keenan-Bolger"],"backdrop_path":"https://image.tmdb.org/t/p/original/8x41z1GIrcO3ZQ8r9VXy7RgaiYr.jpg","poster_path":"https://image.tmdb.org/t/p/original/ay9bbPju7DbIG8pOV78hK9Z7EcG.jpg","certification":"12","genres":["Comédia","Drama","Romance"],"trailer":"N/A"},
